import React, { useState, useEffect } from "react";
import { SafeAreaView, View, Text, TouchableOpacity, StyleSheet, FlatList, ActivityIndicator, Alert } from "react-native";
import Icon from 'react-native-vector-icons/MaterialCommunityIcons';
import { COLORS, SIZES, FONTS } from "../../../constants";
import axios from 'axios';
import { useNavigation } from '@react-navigation/native';
import AsyncStorage from '@react-native-async-storage/async-storage';

const OrderList = () => {
    const navigation = useNavigation();
    const [loading, setLoading] = useState(false);
    const [orders, setOrders] = useState([]);

    useEffect(() => {
        const fetchOrders = async () => {
            setLoading(true);
            try {
                const accessToken = await AsyncStorage.getItem('accessToken');
                if (!accessToken) {
                    console.error('Access token not available');
                    return;
                }

                const response = await axios.get(`http://127.0.0.1:8000/orders/`, {
                    headers: {
                        'Authorization': `Bearer ${accessToken}`,
                    }
                });

                setOrders(response.data);
            } catch (error) {
                console.error("Error fetching orders:", error);
                Alert.alert("Error", "There was an error fetching the orders.");
            } finally {
                setLoading(false);
            }
        };

        fetchOrders();
    }, []);

    const renderItem = ({ item }) => (
        <View style={styles.orderItem}>
            <Text style={styles.foodName}>{item.food.id}</Text>
            <Text style={styles.foodDescription}>{item.food.description}</Text>
            <Text style={styles.foodPrice}>₱{item.food.price}</Text>
            <Text style={styles.orderQuantity}>Quantity: {item.quantity}</Text>
            <Text style={styles.totalPrice}>Total: ₱{item.total_price}</Text>
            <Text style={styles.orderDate}>Ordered on: {new Date(item.created_at).toLocaleDateString()}</Text>
        </View>
    );

    if (loading) {
        return (
            <SafeAreaView style={styles.container}>
                <View style={styles.loader}>
                    <ActivityIndicator size="large" color={COLORS.primary} />
                </View>
            </SafeAreaView>
        );
    }

    return (
        <SafeAreaView style={styles.container}>
            <View style={styles.header}>
                <TouchableOpacity
                    style={styles.iconButton}
                    onPress={() => navigation.goBack()}
                >
                    <Icon name="arrow-left" size={20} color={COLORS.black} />
                </TouchableOpacity>
                <View style={styles.titleContainer}>
                    <Text style={styles.title}>My Orders</Text>
                </View>
            </View>
            <FlatList
                data={orders}
                renderItem={renderItem}
                keyExtractor={(item) => item.id.toString()}
                contentContainerStyle={styles.contentContainer}
                ListEmptyComponent={<Text style={styles.emptyText}>No orders found.</Text>}
            />
        </SafeAreaView>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: COLORS.white,
    },
    header: {
        flexDirection: 'row',
        marginVertical: SIZES.padding * 5,
        paddingHorizontal: SIZES.padding * 3,
        alignItems: 'center',
    },
    iconButton: {
        width: 45,
        alignItems: 'center',
        justifyContent: 'center',
    },
    titleContainer: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
    },
    title: {
        color: COLORS.black,
        ...FONTS.h3,
    },
    contentContainer: {
        paddingHorizontal: SIZES.padding * 3,
    },
    orderItem: {
        backgroundColor: COLORS.lightGray,
        borderRadius: 10,
        padding: SIZES.padding,
        marginVertical: SIZES.padding * 0.5,
    },
    foodName: {
        ...FONTS.h2,
        color: COLORS.black,
    },
    foodDescription: {
        ...FONTS.body3,
        color: COLORS.gray,
        marginVertical: SIZES.padding * 0.5,
    },
    foodPrice: {
        ...FONTS.h2,
        color: COLORS.black,
    },
    orderQuantity: {
        ...FONTS.body3,
        color: COLORS.black,
        marginVertical: SIZES.padding * 0.5,
    },
    totalPrice: {
        ...FONTS.h2,
        color: COLORS.primary,
    },
    orderDate: {
        ...FONTS.body4,
        color: COLORS.gray,
    },
    loader: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
    },
    emptyText: {
        textAlign: 'center',
        ...FONTS.body3,
        color: COLORS.gray,
    },
});

export default OrderList;
